import { useEffect, useState } from 'react';

const Sell = ({ home, provider, account, escrow, togglePop }) => {
  const [purchasePrice, setPurchasePrice] = useState('');
  const [residenceType, setResidenceType] = useState('');
  const [bedrooms, setBedrooms] = useState('');
  const [bathrooms, setBathrooms] = useState('');
  const [squareFeet, setSquareFeet] = useState('');
  const [yearBuilt, setYearBuilt] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Do something with the form data
    console.log({
      purchasePrice,
      residenceType,
      bedrooms,
      bathrooms,
      squareFeet,
      yearBuilt,
    });

    // Clear the form inputs
    setPurchasePrice('');
    setResidenceType('');
    setBedrooms('');
    setBathrooms('');
    setSquareFeet('');
    setYearBuilt('');
  };

  return (
    <div>
      <h1>Sell your home</h1>
      <form onSubmit={handleSubmit} className="w-full mt-[65px] flex flex-col gap-[30px]">
        <div className="flex flex-wrap gap-[40px]">
          <label htmlFor="purchase-price">Purchase Price</label>
          <input
            type="number"
            id="purchase-price"
            value={purchasePrice}
            onChange={(e) => setPurchasePrice(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="residence-type">Type of Residence</label>
          <select
            id="residence-type"
            value={residenceType}
            onChange={(e) => setResidenceType(e.target.value)}
            required
          >
            <option value="">Select</option>
            <option value="Condo">Condo</option>
            <option value="House">House</option>
            <option value="Apartment">Apartment</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="bedrooms">Bed Rooms</label>
          <input
            type="number"
            id="bedrooms"
            value={bedrooms}
            onChange={(e) => setBedrooms(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="bathrooms">Bathrooms</label>
          <input
            type="number"
            id="bathrooms"
            value={bathrooms}
            onChange={(e) => setBathrooms(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="square-feet">Square Feet</label>
          <input
            type="number"
            id="square-feet"
            value={squareFeet}
            onChange={(e) => setSquareFeet(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="year-built">Year Built</label>
          <input
            type="number"
            id="year-built"
            value={yearBuilt}
            onChange={(e) => setYearBuilt(e.target.value)}
            required
          />
        </div>

        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default Sell;
